import React from 'react';
import './App.css';
import { Button, Tooltip } from 'carbon-components-react';


function App() {
  function handleClick(e){
    e.preventDefault();
    console.log('CLICKED');
  }

  return (
    <div className="Manager">
      <header className="Manage-header">
        <Button onClick={handleClick}
          className="Login"
          kind="danger"
          disabled = {false}
        >
          LOGIN HERE
        </Button>
        <Tooltip
        triggerText='This is tooltip'
        direction='bottom'>
        INFORMATION

        </Tooltip>
        <Button>
          Thid button
        </Button>
      </header>
    </div>
  );
}

export default App;
